import React from "react";
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import { Link } from 'react-router-dom'



const menu = ({ tela, menuOpen, abrirFecharMenu }) => (

  <div className="menu">
    <AppBar position="static" style={{ backgroundColor: "#3e0806" }}>
      <Toolbar>
        <IconButton edge="start" color="inherit" aria-label="menu" onClick={() => abrirFecharMenu()}>
          <MenuIcon />
        </IconButton>
        <Typography variant="h6">
          {tela}
        </Typography>
      </Toolbar>
    </AppBar>
    <Menu style={{top:50}} id="simple-menu" keepMounted open={menuOpen} onClose={() => abrirFecharMenu() } className="opcoesMenu">
      <Link to="/">
        <MenuItem>
          Produtos
        </MenuItem>
      </Link>

      <Link to="/listagemPessoa">
        <MenuItem>
          Pessoa
        </MenuItem>
      </Link>

    </Menu>
  </div>
)



export default menu;
